::java::util::particle::DustColor:
Losowy kolor interpretowany na podstawie trzech floatów.

Ściągawka:
- Floaty pomiędzy 0 a 1 są uznawane za procent oryginalnego koloru. Gdy floaty są poza zakresem, dzieją się różne dziwactwa.
- Na każdy kanał dodawane jest 0-20% przyciemnienia.
- Ostateczny kolor jest ciemniejszy o 0-40%.
- `1e100000f` daje stały kanał bez losowości.

Wewnętrzne zachowanie w uproszczeniu ([demo na wykresie] (https://www.desmos.com/calculator/drwzjaxgks)):
```js
function integerToByte(integer) {
if (integer >= 0) {
// Integer is positive
if (integer <= 255) {
// Integer already fits in a color channel
return integer
}
// Integer doesn't fit in color channel; modulo it
return integer % 256
}
// Integer is negative
return Math.abs((Math.floor(integer / 256) * 256)) + integer
}

var baseShade = randomBetween(0.6, 1),
r = integerToByte(Math.floor(color[0] * randomBetween(0.8, 1) * baseShade * 255)),
g = integerToByte(Math.floor(color[1] * randomBetween(0.8, 1) * baseShade * 255)),
b = integerToByte(Math.floor(color[2] * randomBetween(0.8, 1) * baseShade * 255))
```
